import React from 'react'
import multiplePizzas from "..assets/multiplePizzas.jpeg";

function About () {
  return (
    <div className="about">
      <div
        className="aboutTop"
        style={{ backgroundImage: `url(${multiplePizzas})` }}
      ></div>
      <div className="aboutBotton"></div>
    </div>
  );
}

export default  About;
